import React from 'react'
import Unexpanded from './unexpandedComponents/unexpanded'

class Friday extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            expanded: true,
            content: <Unexpanded name="Friday" />
        }
    };
    handleHover = () => {
        this.setState({ expanded: true })
    }

    handleMouseOut = () => {
        this.setState({ expanded: false })
    }

    render() {
        if (this.state.expanded === false) {
            return (
                <div className='Weekday' onMouseOver={this.handleHover}>
                    {this.state.content}
                </div>
            )
        } else {
            return (
                <div onMouseOut={this.handleMouseOut}>
                    <ul className='Weekday-Expanded'>
                        <li>00:00 - 02:59</li>
