                        <h1></h1>
                        <li>06:00 - 08:59</li>
                        <h1></h1>
                        <li>09:00 - 11:59</li>
                        <h1></h1>
                        <li>12:00 - 14:59</li>
                        <h1></h1>
                        <li>15:00 - 17:59</li>
                        <h1></h1>
                        <li>18:00 - 20:59</li>
                        <h1></h1>
                        <li>21:00 - 23:59</li>
                        <h1></h1>
                    </ul>
                </div>
            )
        }
    }
}

export default Friday
